const Icon = ({ image, name, size , role, href }) => (

    <div> 
        <p> {role} </p>
        <a href={href} target="_blank" rel="noopener noreferrer">
        <img
            src={image}
                alt={role}
        />
        </a>
    </div>


  );


  export default Icon;
